description:
Read with us in REVELATION 21. Here we see a new heaven and a new earth. Consider the different roles in Heaven, where the Alpha and Omega dwells. Learn how our lives are transformed when we live according to the promises of the Lord!
Athey Creek Christian Fellowship is a body of believers in Wilsonville Oregon desiring to know the Lord in an ever-increasing measure. We are a non- denominational fellowship associating with all who are in the Body of Christ.  
